-- Volcando estructura para disparador educa.educacion_before_insert
DROP TRIGGER IF EXISTS `educacion_before_insert`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO';
DELIMITER //
CREATE TRIGGER `educacion_before_insert` BEFORE INSERT ON `educacion` FOR EACH ROW BEGIN
  update data_general set estatus_med=new.estatus where cedula=new.cedula;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;


-- Volcando estructura para disparador educa.educacion_before_update
DROP TRIGGER IF EXISTS `educacion_before_update`;
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='';
DELIMITER //
CREATE TRIGGER `educacion_before_update` BEFORE UPDATE ON `educacion` FOR EACH ROW BEGIN
  update data_general set estatus_med=new.estatus where cedula=new.cedula;
  if (new.estatus<>'Activo') then
     update data_general set observacion=concat(new.estatus, ';',new.obs,';',new.tipomodulo) where cedula=new.cedula;
  else
	  update data_general set estatus_med=new.estatus where cedula=new.cedula;
  end if;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;


-- Volcando estructura para vista educa.viewcentrosg
DROP VIEW IF EXISTS `viewcentrosg`;
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `viewcentrosg`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` VIEW `viewcentrosg` AS select `view_centros`.`id_centros` AS `id_centros`,`view_centros`.`centro` AS `centro`,`view_centros`.`Localidad` AS `Localidad`,`view_centros`.`Ubicacion` AS `Ubicacion`,`view_centros`.`direccion` AS `direccion`,`view_centros`.`telefonos` AS `telefonos`,`view_centros`.`tipo_centro` AS `tipo_centro`,`view_centros`.`clasificacion` AS `clasificacion`,`view_centros`.`horario` AS `horario`,`view_centros`.`municipio` AS `municipio`,`view_centros`.`dtto` AS `dtto`,`view_centros`.`parroquia` AS `parroquia`,`view_centros`.`id_estado` AS `id_estado`,`estados`.`estado` AS `estado` from (`view_centros` join `estados` on((`view_centros`.`id_estado` = `estados`.`id_estado`))) group by 1 order by `view_centros`.`dtto` ;


