	`view_educadatos`.`articulo8` AS `articulo8`,
	`view_educadatos`.`residente` AS `residente`,
	`view_educadatos`.`anio_residente` AS `anio_residente`,
	`view_educadatos`.`ra` AS `ra`,
	`view_educadatos`.`anio_ra` AS `anio_ra`,
	`view_educadatos`.`rap` AS `rap`,
	`view_educadatos`.`anio_rap` AS `anio_rap`,
	`view_educadatos`.`medgeneral` AS `medgeneral`,
	`view_educadatos`.`educa` AS `educa`,
	`view_educadatos`.`obs` AS `obs`,
	`view_educadatos`.`id_centro` AS `id_centro`,
	`view_educadatos`.`centro` AS `centro`,
	`view_educadatos`.`municipio` AS `municipio`,
	`view_educadatos`.`parroquia` AS `parroquia`,
	`view_educadatos`.`dtto` AS `dtto`,
	`view_educadatos`.`traslado` AS `traslado`,
	`data_general`.`estatus_med` AS `estatus_med`
