salud`.`id_centros` AS `id_centros`,`centrosalud`.`Centros` AS `Centros`,`centrosalud`.`Localidad` AS `Localidad`,`centrosalud`.`Ubicacion` AS `Ubicacion`,`centrosalud`.`direccion` AS `direccion`,`centrosalud`.`telefonos` AS `telefonos`,`centrosalud`.`tipo_centro` AS `tipo_centro`,`centrosalud`.`clasificacion` AS `clasificacion`,`municipios`.`id_estado` AS `id_estado`,`centrosalud`.`horario` AS `horario`,`municipios`.`municipio` AS `municipio`,`municipios`.`dtto` AS `dtto`,`parroquias`.`parroquia` AS `parroquia` from ((`centrosalud` join `municipios` on((`municipios`.`id_municipio` = `centrosalud`.`id_municipio`))) left join `parroquias` on(((`parroquias`.`id_municipio` = `municipios`.`id_municipio`) and (`parroquias`.`id_parroquia` = `centrosalud`.`id_parroquia`)))) where (`centrosalud`.`tipo_centro` = 'ASIC') union all select `centrosalud`.`id_centros` AS `id_centros`,`centrosalud`.`Centros` AS `Centros`,`centrosalud`.`Localidad` AS `Localidad`,`centrosalud`.`Ubicacion` AS `Ubicacion`,`centrosalud`.`direccion` AS `direccion`,`centrosalud`.`telefonos` AS `telefonos`,`centrosalud`.`tipo_centro` AS `tipo_centro`,`centrosalud`.`clasificacion` AS `clasificacion`,`municipios`.`id_estado` AS `id_estado`,`centrosalud`.`horario` AS `horario`,`municipios`.`municipio` AS `municipio`,`municipios`.`dtto` AS `dtto`,`parroquias`.`parroquia` AS `parroquia` from ((`centrosalud` left join `municipios` on((`municipios`.`id_municipio` = `centrosalud`.`id_municipio`))) left join `parroquias` on(((`parroquias`.`id_municipio` = `municipios`.`id_municipio`) and (`parroquias`.`id_parroquia` = `centrosalud`.`id_parroquia`)))) where (`centrosalud`.`tipo_centro` = 'Consultorio Medico Popular') group by 1 order by 1 ;


