-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `view_residente_dtto`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `view_residente_dtto` AS SELECT
	`educacion`.`residente` AS `residente`,
	`educacion`.`anio_residente` AS `anio_residente`,
	`view_centros`.`dtto` AS `dtto`,
	count(`educacion`.`residente`) AS `canti`
FROM
	(
		`educacion`
		JOIN `view_centros` ON (
			(
				`educacion`.`id_centro` = `view_centros`.`id_centros`
			)
		)
	)
WHERE
	(
		(
			`educacion`.`estatus` = 'Activo'
		)
		AND (
			length(`educacion`.`residente`) > 2
		)
	)
GROUP BY
	1,
	2,
	3
ORDER BY
	3,
	4 ;


-- Volcando estructura para vista educa.view_resumcentrodtto
