CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`127.0.0.1` VIEW `view_resumcentrodtto` AS select id_centro,centro,dtto,tipomodulo,tiempo,count(centro) as cantidad from view_listadogeneral
where estatus_med in ('Activo','Graduado')
and tipomodulo is not null 
group by 1,2,3,4,5 ;


-- Volcando estructura para vista educa.view_resumenepidemiologia
DROP VIEW IF EXISTS `view_resumenepidemiologia`;
-- Eliminando tabla temporal y crear estructura final de VIEW
