CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `view_resumenepidemiologia` AS select `a`.`id_centro` AS `id_centro`,`b`.`centro` AS `centro`,(select count(`x`.`anio_residente`) from `educacion` `x` where ((`x`.`id_centro` = `a`.`id_centro`) and (`x`.`anio_residente` = '1ero') and (`x`.`tipomodulo` = 'EPIDEMIOLOGIA'))) AS `Primer`,(select count(`x`.`anio_residente`) from `educacion` `x` where ((`x`.`id_centro` = `a`.`id_centro`) and (`x`.`anio_residente` = '2do') and (`x`.`tipomodulo` = 'EPIDEMIOLOGIA'))) AS `Segundo`,(select count(`x`.`anio_residente`) from `educacion` `x` where ((`x`.`id_centro` = `a`.`id_centro`) and (`x`.`anio_residente` = '3ero') and (`x`.`tipomodulo` = 'EPIDEMIOLOGIA'))) AS `Tercero`,(((select count(`x`.`anio_residente`) from `educacion` `x` where ((`x`.`id_centro` = `a`.`id_centro`) and (`x`.`anio_residente` = '1ero') and (`x`.`tipomodulo` = 'EPIDEMIOLOGIA'))) + (select count(`x`.`anio_residente`) from `educacion` `x` where ((`x`.`id_centro` = `a`.`id_centro`) and (`x`.`anio_residente` = '2do') and (`x`.`tipomodulo` = 'EPIDEMIOLOGIA')))) + (select count(`x`.`anio_residente`) from `educacion` `x` where ((`x`.`id_centro` = `a`.`id_centro`) and (`x`.`anio_residente` = '3ero') and (`x`.`tipomodulo` = 'EPIDEMIOLOGIA')))) AS `total` from (`educacion` `a` join `view_centros` `b` on((`a`.`id_centro` = `b`.`id_centros`))) where ((`a`.`tipomodulo` = 'EPIDEMIOLOGIA') and (`a`.`estatus` in ('Activo','Graduado'))) group by 1 order by 1 ;


-- Volcando estructura para vista educa.view_resumenmedgeneral
DROP VIEW IF EXISTS `view_resumenmedgeneral`;
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `view_resumenmedgeneral`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `view_resumenmedgeneral` AS SELECT
	`a`.`id_centro` AS `id_centro`,
	`b`.`centro` AS `centro`,
	count(`a`.`medgeneral`) AS `total`
FROM
	(
		`educacion` `a`
		JOIN `view_centros` `b` ON (
			(
				`a`.`id_centro` = `b`.`id_centros`
			)
		)
	)
WHERE
	(
		(
			`a`.`tipomodulo` = 'MEDICOGENERAL'
		)
		AND (`a`.`estatus` in ('Activo','Graduado'))
	)
GROUP BY
	1
ORDER BY
	1 ;


-- Volcando estructura para vista educa.view_resumenmedicos
DROP VIEW IF EXISTS `view_resumenmedicos`;
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `view_resumenmedicos`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `view_resumenmedicos` AS select `educacion`.`residente` AS `residente`,count(`educacion`.`residente`) AS `cantidad` from `educacion` where ((`educacion`.`estatus` = 'Activo') and (length(`educacion`.`residente`) > 2)) group by 1 union all select '(RA)' AS `(RA)`,count(`educacion`.`ra`) AS `count(ra)` from `educacion` where ((length(`educacion`.`ra`) > 6) and (`educacion`.`estatus` = 'Activo')) group by 1 union all select '(RAP)' AS `(RAP)`,count(`educacion`.`rap`) AS `count(rap)` from `educacion` where ((length(`educacion`.`rap`) > 6) and (`educacion`.`estatus` = 'Activo')) group by 1 union all select 'POSTGRADOS' AS `POSTGRADOS`,count(`educacion`.`postgrados`) AS `count(postgrados)` from `educacion` where ((length(`educacion`.`postgrados`) > 6) and (`educacion`.`estatus` = 'Activo')) group by 1 union all select 'MEDICO GENERAL' AS `MEDICO GENERAL`,count(`educacion`.`medgeneral`) AS `count(medgeneral)` from `educacion` where ((length(`educacion`.`medgeneral`) > 6) and (`educacion`.`estatus` = 'Activo')) group by 1 ;


