lo` = 'MGI') and (`x`.`estatus` In('Activo','Graduado'))))) + (select count(`x`.`anio_residente`) from (`educacion` `x` join `data_general` `c` on((`x`.`cedula` = `c`.`cedula`))) where ((`x`.`id_centro` = `a`.`id_centro`) and (`c`.`cohorte` = 3) and (`x`.`tipomodulo` = 'MGI') and (`x`.`estatus` In('Activo','Graduado'))))) + (select count(`x`.`anio_residente`) from (`educacion` `x` join `data_general` `c` on((`x`.`cedula` = `c`.`cedula`))) where ((`x`.`id_centro` = `a`.`id_centro`) and (`c`.`cohorte` = 4) and (`x`.`tipomodulo` = 'MGI') and (`x`.`estatus` In('Activo','Graduado'))))) + (select count(`x`.`anio_residente`) from (`educacion` `x` join `data_general` `c` on((`x`.`cedula` = `c`.`cedula`))) where ((`x`.`id_centro` = `a`.`id_centro`) and (`c`.`cohorte` = 5) and (`x`.`tipomodulo` = 'MGI') and (`x`.`estatus` In('Activo','Graduado'))))) AS `total` from (`educacion` `a` join `view_centros` `b` on((`a`.`id_centro` = `b`.`id_centros`))) where ((`a`.`tipomodulo` = 'MGI') and (`a`.`estatus` In('Activo','Graduado'))) group by 1,3 order by 1 ;


