-- Volcando estructura para vista educa.view_resum_gralcentro
DROP VIEW IF EXISTS `view_resum_gralcentro`;
-- Eliminando tabla temporal y crear estructura final de VIEW
DROP TABLE IF EXISTS `view_resum_gralcentro`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `view_resum_gralcentro` AS SELECT id_centros,centro,dtto,
(SELECT sum(b.cantidad) from  view_resumcentrodtto b where v.id_centros=b.id_centro and b.tipomodulo='MEDICOGENERAL') as 'MEDICOGENERAL',
(SELECT sum(c.cantidad) from  view_resumcentrodtto c where v.id_centros=c.id_centro and c.tipomodulo='MEDICORURAL') as 'MEDICORURAL',
(SELECT sum(j.cantidad) from  view_resumcentrodtto j where v.id_centros=j.id_centro and j.tipomodulo='MGI' and j.tiempo='1ero') as 'MGI1ero',
(SELECT sum(k.cantidad) from  view_resumcentrodtto k where v.id_centros=k.id_centro and k.tipomodulo='MGI' and k.tiempo='2do') as 'MGI2do',
(SELECT sum(m.cantidad) from  view_resumcentrodtto m where v.id_centros=m.id_centro and m.tipomodulo='MGI' and m.tiempo='3ero') as 'MGI3ero',
(SELECT sum(g.cantidad) from  view_resumcentrodtto g where v.id_centros=g.id_centro and g.tipomodulo='PUBLICA' and g.tiempo='1ero') as 'PUBLICA1ero',
(SELECT sum(h.cantidad) from  view_resumcentrodtto h where v.id_centros=h.id_centro and h.tipomodulo='PUBLICA' and h.tiempo='2do') as 'PUBLICA2do',
(SELECT sum(i.cantidad) from  view_resumcentrodtto i where v.id_centros=i.id_centro and i.tipomodulo='PUBLICA' and i.tiempo='3ero') as 'PUBLICA3ero',
(SELECT sum(d.cantidad) from  view_resumcentrodtto d where v.id_centros=d.id_centro and d.tipomodulo='EPIDEMIOLOGIA' and d.tiempo='1ero') as 'EPI1ero',
(SELECT sum(e.cantidad) from  view_resumcentrodtto e where v.id_centros=e.id_centro and e.tipomodulo='EPIDEMIOLOGIA' and e.tiempo='2do') as 'EPI2do',
(SELECT sum(f.cantidad) from  view_resumcentrodtto f where v.id_centros=f.id_centro and f.tipomodulo='EPIDEMIOLOGIA' and f.tiempo='3ero') as 'EPI3ero',
(SELECT sum(a.cantidad) from  view_resumcentrodtto a where v.id_centros=a.id_centro and a.tipomodulo='RA-1' and a.tiempo='1ero') as 'RA1ero',
(SELECT sum(n.cantidad) from  view_resumcentrodtto n where v.id_centros=n.id_centro and n.tipomodulo='RA-1' and n.tiempo='2do') as 'RA2do',
(SELECT sum(o.cantidad) from  view_resumcentrodtto o where v.id_centros=o.id_centro and o.tipomodulo='RAP' and o.tiempo='1ero') as 'RAP1ero',
(SELECT sum(p.cantidad) from  view_resumcentrodtto p where v.id_centros=p.id_centro and p.tipomodulo='RAP' and p.tiempo='2do') as 'RAP2do',
(SELECT sum(q.cantidad) from  view_resumcentrodtto q where v.id_centros=q.id_centro and q.tipomodulo='RAP' and q.tiempo='3ero') as 'RAP3ero',
(SELECT sum(r.cantidad) from  view_resumcentrodtto r where v.id_centros=r.id_centro and r.tipomodulo='POSTGRADO') as 'Postgrados'
FROM view_centros v ;


-- Volcando estructura para vista educa.view_resum_mgi
