CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `view_tot_centros` AS select `a`.`id_centro` AS `id_centro`,`a`.`centro` AS `centro`,(select count(`x`.`residente`) from `view_educadatos` `x` where ((`x`.`residente` = 'MGI') and (`x`.`id_centro` = `a`.`id_centro`))) AS `MGI`,(select count(`y`.`residente`) from `view_educadatos` `y` where ((`y`.`residente` = 'EPIDEMIOLOGIA') and (`y`.`id_centro` = `a`.`id_centro`))) AS `EPIDEMIOLOGIA`,(select count(`z`.`ra`) from `view_educadatos` `z` where ((length(`z`.`ra`) > 3) and (`z`.`id_centro` = `a`.`id_centro`))) AS `RA`,(select count(`w`.`rap`) from `view_educadatos` `w` where ((length(`w`.`rap`) > 3) and (`w`.`id_centro` = `a`.`id_centro`))) AS `RAP`,(select count(`c`.`residente`) from `view_educadatos` `c` where ((`c`.`residente` = 'SALUD PUBLICA') and (`c`.`id_centro` = `a`.`id_centro`))) AS `SALUDPUBLICA`,(select count(`s`.`medgeneral`) from `view_educadatos` `s` where ((`s`.`medgeneral` = 'MEDICO GENERAL') and (`s`.`id_centro` = `a`.`id_centro`))) AS `MEDICOGENERAL`,(select count(`s`.`medicorural`) from `view_educadatos` `s` where ((`s`.`medicorural` = 'MEDICO RURAL') and (`s`.`id_centro` = `a`.`id_centro`))) AS `MEDICORURAL`,(select count(`b`.`rap`) from `view_educadatos` `b` where ((length(`b`.`postgrados`) > 3) and (`b`.`id_centro` = `a`.`id_centro`))) AS `POSTGRADOS`,((((((((select count(`x`.`residente`) from `view_educadatos` `x` where ((`x`.`residente` = 'MGI') and (`x`.`id_centro` = `a`.`id_centro`))) + (select count(`y`.`residente`) from `view_educadatos` `y` where ((`y`.`residente` = 'EPIDEMIOLOGIA') and (`y`.`id_centro` = `a`.`id_centro`)))) + (select count(`z`.`ra`) from `view_educadatos` `z` where ((length(`z`.`ra`) > 3) and (`z`.`id_centro` = `a`.`id_centro`)))) + (select count(`w`.`rap`) from `view_educadatos` `w` where ((length(`w`.`rap`) > 3) and (`w`.`id_centro` = `a`.`id_centro`)))) + (select count(`b`.`rap`) from `view_educadatos` `b` where ((length(`b`.`postgrados`) > 3) and (`b`.`id_centro` = `a`.`id_centro`)))) + (select count(`c`.`residente`) from `view_educadatos` `c` where ((`c`.`residente` = 'SALUD PUBLICA') and (`c`.`id_centro` = `a`.`id_centro`)))) + (select count(`s`.`medgeneral`) from `view_educadatos` `s` where ((`s`.`medgeneral` = 'MEDICO GENERAL') and (`s`.`id_centro` = `a`.`id_centro`)))) + (select count(`s`.`medicorural`) from `view_educadatos` `s` where ((`s`.`medicorural` = 'MEDICO RURAL') and (`s`.`id_centro` = `a`.`id_centro`)))) AS `total` from `view_educadatos` `a` where (`a`.`centro` is not null) group by 1,2 order by 1 ;


